// keep all your existing imports
import React, { useState, useEffect } from "react";
import Modal from "react-modal";
import "./services.css";

const Services = () => {
  useEffect(() => {
    const root = document.getElementById("root");
    if (root) {
      Modal.setAppElement(root);
    }
  }, []);

  const servicesData = [
    { title: "Individual Therapy", description: "One-on-one sessions to help you navigate personal challenges and improve mental well-being.", icon: "ðŸ§ " },
    { title: "Couples Therapy", description: "Sessions designed to enhance communication and resolve conflicts in relationships.", icon: "â¤ï¸" },
    { title: "Group Therapy", description: "Join a supportive group setting to share experiences and gain insights.", icon: "ðŸ‘¥" },
    { title: "Child and Adolescent Therapy", description: "Specialized therapy for young individuals dealing with various emotional challenges.", icon: "ðŸ‘¶" },
    { title: "Online Therapy", description: "Access professional support from the comfort of your home through secure online sessions.", icon: "ðŸ’»" },
    { title: "Career & Life Coaching", description: "Guidance and support to help you achieve personal and professional goals.", icon: "ðŸŽ¯" },
    { title: "Self Assessment", description: "Take self-tests to evaluate your mental health.", icon: "ðŸ“Š" },
  ];

  const quizzes = {
    ADHD: [
      { id: "q1", question: "Do you often struggle to concentrate?" },
      { id: "q2", question: "Are you easily distracted by surroundings or thoughts?" },
      { id: "q3", question: "Do you find it hard to complete tasks?" },
    ],
    Anxiety: [
      { id: "q1", question: "Do you often feel nervous or anxious?" },
      { id: "q2", question: "Do you worry excessively about different things?" },
      { id: "q3", question: "Do you experience sweating or rapid heartbeat?" },
    ],
    OCD: [
      { id: "q1", question: "Do you have repeated thoughts that make you anxious?" },
      { id: "q2", question: "Do you feel compelled to perform rituals?" },
      { id: "q3", question: "Do these behaviors interfere with your daily life?" },
    ],
    Depression: [
      { id: "q1", question: "Do you feel hopeless or have low energy frequently?" },
      { id: "q2", question: "Do you find little pleasure in doing things?" },
      { id: "q3", question: "Have you experienced changes in sleep or appetite?" },
    ],
    PTSD: [
      { id: "q1", question: "Do you experience flashbacks or nightmares?" },
      { id: "q2", question: "Do certain triggers cause extreme distress?" },
      { id: "q3", question: "Do you avoid people or places linked to a past trauma?" },
    ],
  };

  const timeSlots = [
    "10:00 AM - 12:00 PM",
    "12:00 PM - 2:00 PM",
    "2:00 PM - 4:00 PM",
    "4:00 PM - 6:00 PM",
    "6:00 PM - 8:00 PM",
  ];

  const therapyServices = {
    "Individual Therapy": ["Stress Management", "Depression Counseling", "Anxiety Therapy", "Self-Improvement"],
    "Couples Therapy": ["Relationship Counseling", "Marriage Therapy", "Conflict Resolution", "Pre-Marital Counseling"],
    "Group Therapy": ["Ex-Defence Personnel", "Widows", "Divorcees", "LGBTQ+ Support", "Substance Recovery Groups"],
    "Child and Adolescent Therapy": ["Behavioral Therapy", "Academic Stress Management", "Bullying Support", "Parental Guidance"],
    "Online Therapy": ["Virtual Individual Sessions", "Video Counseling", "Text-Based Therapy", "Phone Consultations"],
    "Career & Life Coaching": ["Career Counseling", "Goal Setting", "Work-Life Balance", "Entrepreneurship Guidance"],
  };

  const [showForm, setShowForm] = useState(false);
  const [showPaymentPopup, setShowPaymentPopup] = useState(false);
  const [showSuccessPopup, setShowSuccessPopup] = useState(false);
  const [selectedService, setSelectedService] = useState("");
  const [formData, setFormData] = useState({
    name: "",
    spouseName: "",
    childName: "",
    mobile: "",
    email: "",
    date: "",
    time: "",
    service: "",
  });

  const [showAssessmentPopup, setShowAssessmentPopup] = useState(false);
  const [quizType, setQuizType] = useState("");
  const [quizAnswers, setQuizAnswers] = useState({});
  const [quizResult, setQuizResult] = useState(null);

  const today = new Date();
  today.setDate(today.getDate() + 1);
  const minDate = today.toISOString().split("T")[0];

  const handleInputChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleNextToPayment = (e) => {
    e.preventDefault();
    setShowPaymentPopup(true);
  };

  const handleFinalSubmit = async () => {
    const token = localStorage.getItem("token");
    if (!token) {
      alert("You must be logged in to book an appointment.");
      return;
    }

    const appointmentData = {
      name: formData.name,
      spouseName: formData.spouseName,
      childName: formData.childName,
      mobile: formData.mobile,
      email: formData.email,
      date: formData.date,
      time: formData.time,
      mainService: selectedService,
      subService: formData.service,
    };

    try {
      const response = await fetch("http://localhost:5000/api/appointments", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
          Authorization: `Bearer ${token}`,
        },
        body: JSON.stringify(appointmentData),
      });

      const data = await response.json();

      if (response.ok) {
        setShowSuccessPopup(true);
        setShowForm(false);
        setShowPaymentPopup(false);
        setFormData({
          name: "",
          spouseName: "",
          childName: "",
          mobile: "",
          email: "",
          date: "",
          time: "",
          service: "",
        });
      } else {
        alert(`âŒ ${data.message || "Something went wrong!"}`);
      }
    } catch (err) {
      console.error(err);
      alert("âŒ Failed to connect to the server.");
    }
  };

  const handleServiceClick = (service) => {
    if (service === "Self Assessment") {
      setShowAssessmentPopup(true);
      setSelectedService(service);
    } else {
      setSelectedService(service);
      setFormData({
        name: "",
        spouseName: "",
        childName: "",
        mobile: "",
        email: "",
        date: "",
        time: "",
        service: therapyServices[service][0],
      });
      setShowForm(true);
    }
  };

  const handleQuizSubmit = () => {
    const score = Object.values(quizAnswers).filter((ans) => ans === "yes").length;
    let result = "Minimal signs detected.";
    if (score === 2) result = "Moderate indicators. You may consider speaking to a professional.";
    if (score === 3) result = "Strong indicators. It's highly recommended to consult a therapist.";
    setQuizResult(result);
  };

  return (
    <div className="services-container">
      <h1 className="services-title">Our Services</h1>
      <p className="services-description">Explore the range of therapy services we offer to support your mental health journey.</p>

      <div className="services-grid">
        {servicesData.map((service, index) => (
          <div
            key={index}
            className="service-card"
            onClick={() => handleServiceClick(service.title)}
          >
            <div className="service-icon">{service.icon}</div>
            <h2 className="service-title">{service.title}</h2>
            <p className="service-description">{service.description}</p>
          </div>
        ))}
      </div>

      {/* -- Keep your existing Modals here: Booking, Payment, Success */}
      {/* -- APPENDED NEW SELF ASSESSMENT MODAL BELOW -- */}

      <Modal
        isOpen={showAssessmentPopup}
        onRequestClose={() => {
          setShowAssessmentPopup(false);
          setQuizType("");
          setQuizAnswers({});
          setQuizResult(null);
        }}
        className="popup-form"
        overlayClassName="popup-overlay"
      >
        <h2>ðŸ§ª Mental Health Self Assessment</h2>
        {!quizType ? (
          <div className="self-assessment-buttons">
            {Object.keys(quizzes).map((type) => (
              <button
                key={type}
                type="button"
                onClick={() => setQuizType(type)}
                className="self-assessment-btn"
              >
                {type} Test
              </button>
            ))}
          </div>
        ) : quizResult ? (
          <div>
            <p><strong>Result:</strong> {quizResult}</p>
            <button onClick={() => { setQuizResult(null); setQuizAnswers({}); }}>Retake</button>
            <button onClick={() => setQuizType("")}>Back</button>
          </div>
        ) : (
          <div>
            {quizzes[quizType].map((q) => (
              <div key={q.id}>
                <label>{q.question}</label>
                <select
                  onChange={(e) =>
                    setQuizAnswers({ ...quizAnswers, [q.id]: e.target.value })
                  }
                >
                  <option value="">Select</option>
                  <option value="yes">Yes</option>
                  <option value="no">No</option>
                </select>
              </div>
            ))}
            <button
              onClick={handleQuizSubmit}
              disabled={Object.keys(quizAnswers).length < 3}
            >
              Submit
            </button>
          </div>
        )}
      </Modal>

      {/* -- Keep all your other modals intact here (Booking, Payment, Success) -- */}
    </div>
  );
};

export default Services;
